.xterm {
  font-feature-settings: 'liga' 0;
  position: relative;
  user-select: none;
  -ms-user-select: none;
  -webkit-user-select: none;
}

.xterm.focus,
.xterm:focus {
  outline: none;
}

.xterm .xterm-helpers {
  position: absolute;
  top: 0;
  /**
 * The z-index of the helpers must be higher than the canvases in order for
 * IMEs to appear on top.
 */
  z-index: 5;
}

.xterm .xterm-helper-textarea {
  padding: 0;
  border: 0;
  margin: 0;
  /* Move textarea out of the screen to the far left, so that the cursor is not visible */
  position: absolute;
  opacity: 0;
  left: -9999em;
  top: 0;
  width: 0;
  height: 0;
  z-index: -5;
  /** Prevent wrapping so the IME appears against the textarea at the correct position */
  white-space: nowrap;
  overflow: hidden;
  resize: none;
}

.xterm .composition-view {
  background: #000;
  color: #fff;
  display: none;
  position: absolute;
  white-space: nowrap;
  z-index: 1;
}

.xterm .composition-view.active {
  display: block;
}

.xterm .xterm-viewport {
  /* On OS X this is required in order for the scroll bar to appear fully opaque */
  background-color: #000;
  overflow-y: scroll;
  cursor: default;
  position: absolute;
  right: 0;
  left: 0;
  top: 0;
  bottom: 0;
}

.xterm .xterm-screen {
  position: relative;
}

.xterm .xterm-screen canvas {
  position: absolute;
  left: 0;
  top: 0;
}

.xterm .xterm-scroll-area {
  visibility: hidden;
}

.xterm-char-measure-element {
  display: inline-block;
  visibility: hidden;
  position: absolute;
  top: 0;
  left: -9999em;
  line-height: normal;
}

.xterm {
  cursor: text;
}

.xterm.enable-mouse-events {
  /* When mouse events are enabled (eg. tmux), revert to the standard pointer cursor */
  cursor: default;
}

.xterm.xterm-cursor-pointer {
  cursor: pointer;
}

.xterm.column-select.focus {
  /* Column selection mode */
  cursor: crosshair;
}

.xterm .xterm-accessibility,
.xterm .xterm-message {
  position: absolute;
  left: 0;
  top: 0;
  bottom: 0;
  right: 0;
  z-index: 10;
  color: transparent;
}

.xterm .live-region {
  position: absolute;
  left: -9999px;
  width: 1px;
  height: 1px;
  overflow: hidden;
}

.xterm-dim {
  opacity: 0.5;
}

.xterm-underline {
  text-decoration: underline;
}

::-webkit-scrollbar {
  width: 5px;
  background: rgba(118, 176, 243, 0.3);
  border-radius: 2px;
}

::-webkit-scrollbar-button {
  display: none;
}

::-webkit-scrollbar-track {
  background-color: black;
}

::-webkit-scrollbar-thumb {
  width: 5px;
  min-height: 15px;
  background: rgba(150, 150, 150, 0.8);
  border-radius: 2px;
}

::-webkit-scrollbar-thumb:hover {
  background: rgba(150, 150, 150, 1);
}

::-webkit-scrollbar-track-piece {
  background: #333;
}

.replayer-wrapper {
  position: relative;
}

.replayer-mouse {
  position: absolute;
  width: 20px;
  height: 20px;
  transition: .05s linear;
  background-size: contain;
  background-position: 50%;
  background-repeat: no-repeat;
  background-image: url('data:image/svg+xml;base64,');
}

.replayer-mouse:after {
  content: "";
  display: inline-block;
  width: 20px;
  height: 20px;
  border-radius: 10px;
  background: #4950f6;
  transform: translate(-10px,-10px);
  opacity: .3;
}

.replayer-mouse.active:after {
  animation: click .2s ease-in-out 1;
}

.replayer-mouse-tail {
  position: absolute;
  pointer-events: none;
}

@keyframes click {
  0% {
    opacity: .3;
    width: 20px;
    height: 20px;
    border-radius: 10px;
    transform: translate(-10px,-10px);
  }

  50% {
    opacity: .5;
    width: 10px;
    height: 10px;
    border-radius: 5px;
    transform: translate(-5px,-5px);
  }
}

.replayer-wrapper>iframe {
  border: none;
}

.replayer-wrapper {
  position: relative;
  float: left;
  clear: both;
  top: 50%;
  left: 50%;
}

.video-wrapper>video {
