#carousel {
  height: 0px;
  margin: 0px auto;
  text-align: left;
  position: relative;
  opacity: 0;
  left: 0px;
}

#carousel::-webkit-scrollbar {
  display: none;
}

#carousel.show {
  height: 9rem;
  opacity: 1;
}

#carousel .nav {
  background: none;
}

#carousel .nav div,
#carousel .nav a {
  background-clip: padding-box;
  background-color: rgba(34, 34, 34, 0.9);
}

#carousel .nav div::after,
#carousel .nav a::after {
  border-radius: 6px;
  border-left: 6px solid rgba(255, 255, 255, 0.8);
  border-bottom: 6px solid rgba(255, 255, 255, 0.8);
  box-sizing: border-box;
  height: 100%;
  width: 100%;
  content: "";
  position: absolute;
}

#carousel .nav div:hover::after,
#carousel .nav div.\:hover::after,
#carousel .nav a:hover::after,
#carousel .nav a.\:hover::after {
  border-left: 6px solid rgb(255, 255, 255);
  border-bottom: 6px solid rgb(255, 255, 255);
}

#carousel .nav div.disabled,
#carousel .nav a.disabled {
  pointer-events: none;
  cursor: auto;
}

#carousel .nav div.disabled::after,
#carousel .nav a.disabled::after {
  border-left: 6px solid rgba(255, 255, 255, 0.4);
  border-bottom: 6px solid rgba(255, 255, 255, 0.4);
}

#carousel .nav .rightNav,
#carousel .nav .leftNav,
#carousel .nav .down {
  position: relative;
  cursor: pointer;
  background: none;
  width: 0.5rem;
  height: 0.5rem;
}

#carousel .nav .rightNav::after {
  transform: rotate(225deg) scale(0.5);
}

#carousel .nav .leftNav::after {
  transform: rotate(45deg) scale(0.5);
}

#carousel .nav .down::after {
  transform: scale(0.25) translateY(-25%) rotate(-45deg);
}

#carousel .nav .edit_interests {
  cursor: pointer;
  display: none;
  left: calc(2.75rem);
  margin: 0px 0px 0.5rem;
  border-radius: 6px;
  background-color: rgba(34, 34, 34, 0.9);
  bottom: 100%;
  position: absolute;
  height: 2.5rem;
  width: 2.5rem;
}

#carousel .nav .edit_interests svg {
  fill: white;
  transform: translate3d(-50%, -50%, 0px);
  top: 50%;
  left: 50%;
  position: absolute;
}

#carousel .nav .edit_interests::after {
  display: none;
}

#carousel .nav .leftNav,
#carousel .nav .rightNav,
#carousel .nav .down {
  height: 2.5rem;
  width: 2.5rem;
  position: absolute;
}

#carousel .nav .leftNav,
#carousel .nav .rightNav {
  top: 50%;
  transform: translate3d(0px, -50%, 0px);
}

#carousel .nav .leftNav {
  right: 102%;
}

#carousel .nav .rightNav {
  left: 102%;
}

#carousel .nav .down {
  border-radius: 6px;
  margin: 0px 0px 0.5rem;
  background-color: rgba(34, 34, 34, 0.9);
  left: 0px;
  top: auto;
  transform: none;
  bottom: 100%;
}

#carousel #crs_pane {
  overflow: scroll hidden;
  padding: 0px 0px 1.25rem;
  margin: auto;
  min-width: 25rem;
  white-space: nowrap;
  list-style: none;
}

#carousel #crs_pane::-webkit-scrollbar {
  width: 0px;
  background: transparent;
}

#carousel #crs_pane .tile_grp {
  display: inline-block;
}

#carousel #crs_pane .tile_grp:first-child {
  margin-left: -0.25rem;
}

#carousel #crs_pane .pntile,
#carousel #crs_pane .itile {
  border-radius: 6px;
  height: 7.75rem;
  width: 11.625rem;
  overflow: hidden;
  white-space: normal;
  color: rgb(255, 255, 255);
  vertical-align: top;
  position: relative;
  cursor: pointer;
  background-color: rgba(34, 34, 34, 0.9);
  margin: 0px 0.25rem;
  display: inline-block;
}

#carousel #crs_pane .pntile.crs_wide,
#carousel #crs_pane .itile.crs_wide {
  width: 14.0625rem;
}

